"""
Given a list of unique words, return all the pairs of the distinct indices (i, j) in the given list, so that the
 concatenation of the two words words[i] + words[j] is a palindrome.
"""
from typing import List, Tuple


def palindrome_pairs(words: List[str]) -> List[Tuple[int, int]]:
    """
    :param words: 1 <= len(words) <= 5000 unique words, with 0 <= len(words[i]) <= 300.
        words[i] consists of lowercase English letters only
    :return: pairs of indices i != j, such that words[i] + words[j] is a palindrome
    """

    def is_palindrome(s: str) -> bool:
        return s == s[::-1]

    words_map = {word: i for i, word in enumerate(words)}
    valid_pairs = []
    for i, word in enumerate(words):
        word_len = len(word)
        for split_at in range(word_len + 1):
            word_prefix = word[:split_at]
            word_suffix = word[split_at:]
            if is_palindrome(word_prefix):
                reverse_suffix = word_suffix[::-1]
                if reverse_suffix != word and reverse_suffix in words_map:
                    # reverse_suffix + word_prefix + word_suffix = reverse_suffix + word
                    valid_pairs.append((words_map[reverse_suffix], i))
            if split_at < word_len and is_palindrome(word_suffix):
                reverse_prefix = word_prefix[::-1]
                if reverse_prefix in words_map:
                    # note len(reverse_prefix) < len(word), and hence reverse_prefix != word
                    # word_prefix + word_suffix + reversed_prefix = word + reversed_prefix
                    valid_pairs.append((i, words_map[reverse_prefix]))
    return valid_pairs


